import { Link } from "react-router-dom"

export default function User(){

    const [meals,set]=useState([])

    const[num,inc]=useState(0);


    const [d,dc]=useState('');

    console.log(d)
    useEffect(()=>{
        if(d!='')
        fetch('http://localhost:8000/getmeals',{
            method:'POST',
            headers:{
                'Content-Type': 'application/json',
